import React from 'react'
import {BrowserRouter, Navigate, Route,Routes} from 'react-router-dom'
// import Home from '../home'
import Logins from '../Login/Login'
import Calculator from '../LatihanKomponen/FunctionalComponent'
import ParentComponent from '../ParentChild/ParentComponent'
import GetData from '../ParentChild/GetData'

const MyRoutes = () => {

    return (
          <BrowserRouter>
          <div>
            <Routes>
            <Route path="/login" element={<Logins/>} />
            {/* <Route path="/home" element={<Home/>} /> */}
            <Route path="/calculator" element={<PrivateRoute><Calculator/></PrivateRoute> } />
            <Route path="/parentchild" element={<PrivateRoute><ParentComponent/></PrivateRoute>} />
            <Route path="/GetData" element={<PrivateRoute><GetData/></PrivateRoute>} />
          </Routes>
          </div>
          </BrowserRouter>
        
      )

}
const PrivateRoute = (props) => {
  const token = localStorage.getItem('token')
  if(!token) return <Navigate to ='login'/>
  return props.childern
}
export default MyRoutes
